import React, { useState } from 'react'
import { TableContainer, TableCell, TableHead, TableRow, TableBody, Table, TableSortLabel } from '@mui/material';

function StocksTableView({ data }) {
    const [sortedData, setSortedData] = React.useState(data);
  const [sortConfig, setSortConfig] = React.useState({
    key: null,
    direction: 'asc',
  });
    return (
      <TableContainer>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>Company Name</TableCell>
              <TableCell>Symbol</TableCell>
              <TableCell>BSE Price (INR)</TableCell>
              <TableCell>NSE Price (INR)</TableCell>
              <TableCell>Profit (INR)</TableCell>
              {/* Add more table header cells */}
            </TableRow>
          </TableHead>
          <TableBody>
            {data.map((item) => (
              <TableRow key={item.id}>
                <TableCell>{item.companyName}</TableCell>
                <TableCell>{item.symbol}</TableCell>
                <TableCell>{item.bsePrice}</TableCell>
                <TableCell>{item.nsePrice}</TableCell>
                <TableCell>{Math.round(item.profit)}</TableCell>
                {/* Add more table cells for other data properties */}
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    );
  }
  
//   export default MuiTableView;
  

export default StocksTableView
